import React from 'react';
import { Switch, Route } from 'react-router-dom'
import Blog from '../'
import Login from '../auth/Login';

const Routes = () => {
    return (
        <Switch>
            <Route exact path='/' component={Blog} />
            <Route exact path='/login' component={Login} />
        </Switch>
    )
}
export default Routes;
